Mocha throws timeout exceeded, yet Mongoose saves data to DB in Promise chain?<p>I'm using Mocha, Mongoose and MongoDB.</p>

<p>My goal is simply to run a test around the creation of an account. I have the following code:</p>

<pre><code>require( "./../../config/config" );
var mongoose = require( "mongoose" );
mongoose.connect( process.env.MONGODB_URI );

const expect = require( "expect" );
var { Account } = require( "./../../models/account" );

describe( "Account Creation", () =&gt;
{
    it( "should successfully create an account", ( done ) =&gt;
    {
        var data =
        {
            username: "PrestonJ",
            email: "someEmail@mail.com",
            password: "somePassword123!"
        };

        var account = new Account( data );
        account.save().then( ( result ) =&gt;
        {
            console.log( "(temporary log)  account saved" );
            done();
        }).catch( ( e ) =&gt; done( e ) );
    });
});
</code></pre>

<p>The Mongoose promise chain executes and saves the new account to the database, but <code>done()</code> is never reached (even though it is written, and the console call above it works).</p>

<p>This results in the Mocha test failing, giving me:
<code>Error: Timeout of 2000ms exceeded. For async tests and hooks, ensure "done()" is called; if returning a Promise, ensure it resolves.</code></p>

<p>I have attempted to just <code>return</code> the Promise chain, but that doesn't work either. I have also tried removing <code>done</code> altogether along with returning the chain, to no avail.</p>

<p>It's been several hours and I've been unable to find the right practices/fixes. </p>

<p>Edit:
I have tried increasing the timeout for Mocha. Is the error being swallowed somehow? Is it something in my Model file? </p>

