Why does Mongo FETCH on count() with $nin?<p>I am trying to understand why Mongo can't use a covered index with my query using <code>$nin</code>, and how to resolve it.  My issue is with a compound index, but it happens with a simple index too.</p>

<p>Take a simple document:</p>

<pre><code>{b: "text1"}
</code></pre>

<p>And a simple index:</p>

<pre><code>{
    "v" : 1,
    "key" : {
        "b" : 1
    },
    "name" : "b_1",
    "ns" : "mytest"
}
</code></pre>

<p>And what I thought was a simple <code>count()</code> query:</p>

<pre><code>db.mytest.count( {b: $nin: [ "foo" ]}, {b:1, _id:0} )
</code></pre>

<p>The <code>winningPlan</code> unexpectedly includes a <code>FETCH</code>:</p>

<pre><code>"winningPlan" : {
    "stage" : "COUNT",
    "inputStage" : {
        "stage" : "FETCH",
        "inputStage" : {
            "stage" : "IXSCAN",
            "keyPattern" : {
                "b" : 1
            },
            "indexName" : "b_1",
            "isMultiKey" : false,
            "isUnique" : false,
            "isSparse" : false,
            "isPartial" : false,
            "indexVersion" : 1,
            "direction" : "forward",
            "indexBounds" : {
                "b" : [
                    "[MinKey, \"foo\")",
                    "(\"foo\", MaxKey]"
                ]
            }
        }
    }
}
</code></pre>

<p>But with a simple equality condition it uses <code>COUNT_SCAN</code> (as expected):</p>

<pre><code>&gt; db.mytest.count( {b: "bar" }, {b:1, _id:0} )

"winningPlan" : {
    "stage" : "COUNT",
    "inputStage" : {
        "stage" : "COUNT_SCAN",
        "keyPattern" : {
            "b" : 1
        },
        "indexName" : "b_1",
        "isMultiKey" : false,
        "isUnique" : false,
        "isSparse" : false,
        "isPartial" : false,
        "indexVersion" : 1
    }
},
</code></pre>

<p>To make things more interesting, a <code>find()</code> instead of a <code>count()</code> doesn't look at any documents:</p>

<pre><code>&gt; db.mytest.find({b:{ $nin: [ 3 ] }}, {b:1, _id:0})

"winningPlan" : {
    "stage" : "PROJECTION",
    "transformBy" : {
        "b" : 1,
        "_id" : 0
    },
    "inputStage" : {
        "stage" : "IXSCAN",
        "keyPattern" : {
            "b" : 1
        },
        "indexName" : "b_1",
        "isMultiKey" : false,
        "isUnique" : false,
        "isSparse" : false,
        "isPartial" : false,
        "indexVersion" : 1,
        "direction" : "forward",
        "indexBounds" : {
            "b" : [
                "[MinKey, 3.0)",
                "(3.0, MaxKey]"
            ]
        }
    }
}
</code></pre>

<p>Why does Mongo need to <code>FETCH</code> with <code>$nin</code>?  It should be able to fulfill this exclusively from the index.</p>

